import React, { useRef } from "react";
import { FaBars, FaTimes } from "react-icons/fa";
import classes from "./MenuStructure.module.css"; // Make sure to use ".module.css" for CSS modules

const MenuStructure = () => {
  const navRef = useRef();

  const showNavbar = () => {
    navRef.current.classList.toggle(classes.responsive_nav);
  };

  return (
    <header>
      <h3>Logo</h3>
      <nav ref={navRef} className={`${classes.nav} ${classes.responsive_nav}`}>
        <a href="/#">Profile</a>
        <a href="/#">Language</a>
        <a href="/#">Help</a>
        <a href="/#">Logout</a>
        <a href="/#">About us</a>
        <button className={`nav_btn ${classes.nav_close}`} onClick={showNavbar}>
          <FaTimes />
        </button>
      </nav>
      <button className="nav_btn" onClick={showNavbar}>
        <FaBars />
      </button>
    </header>
  );
};

export default MenuStructure;
